import './App.css';
import Canvas from './canvas.js'
import {map} from './map.js'
import React from 'react'
import Textbox from './textbox.js'

map.deleteAll()

function App() {
  return (
    <body className = "center">
      <div id = 'entername'>
        <Textbox/>
      </div>
      <div className="App">
        <header className="App-header">
          <Canvas id="gameboard" width="1200" height="1200"/>
        </header>
      </div>
    </body>
  );
}


export default App;
